import React, {useEffect} from 'react'

export default function Instagram() {
    const instaFields = 'id,media_type,media_url,thumbnail_url';
    const imgAmount = 3;
    const instaID = '17841424890644350';
    const accessToken = 'EAAlCgw1dfFIBACMKJXJBomLTOOxZBf0JbJzbJZA05vZAHNbgy2bZB44ElcpYez6CW887FPZCZBSPusQWIBPZBUmMtMIQVE4YIZATvdZCwQy9aOTZA7wwWRJt4idsiCAJtwBCSpBe5h9EPqfSjRwXvkirsZC4jX4BMCLJRs0YZAlZCXGLvMI7W4d9gYIVx';
    const instaEndpoint = `https://graph.facebook.com/${instaID}/media?fields=${instaFields}&limit=${imgAmount}&access_token=${accessToken}`;
    console.log(instaEndpoint)
    const getInstaFeed = () => {
        fetch(instaEndpoint).then(res => {
            if (res.ok){
                console.log(res.json())
                return res.json()
            }
            else{
                return 'error';
            }
        })
        .catch(err => {
            console.error(err);
        });
    }

    useEffect(() => {
        console.log(getInstaFeed())
    })




    return (
        <div className='instagramContainer'>
        </div>
    )
}
